import React, {Component} from 'react';
import 'C:/Users/Gebruiker/Desktop/Engineering/demo/src/src/webapp/src/App.css';

class AccountPanel extends Component {

    render() {
        return (
            <div id="accountPanel" className="accountPanel">
                <p className="settingsHeader">Account</p>
                <div className="divider"/>
                <div className="accountObject">
                    <img alt="" className="accountObjectPP" src="pf.png"/>
                        <a className="accountObjectName">Albert</a>
                        <img alt="" className="accountObjectGear" src="gear.png"/>
                </div>
                <p className="myprofile"><a>My Profile</a></p>
            </div>
        );
    }
}

export default AccountPanel;
